import React from 'react'
import './style/nav.css';

export default function Nav() {
  return (
    <div>
        <nav>
          <div className='nav-content'>
            <div className='nav-content-1'>
              h1
            </div>
            <div className='nav-content-2'></div>
          </div>
        </nav>
    </div>
  )
}
